public SimpleOrderedMap readOrderedMap(FastInputStream dis) throws IOException {
  int sz = readSize(dis);
  SimpleOrderedMap nl = new SimpleOrderedMap();
  for (int i = 0; i < sz; i++) {
    String name = (String)readVal(dis);
    Object val = readVal(dis);
    nl.add(name, val);
  }
  return nl;
}

